import React from 'react'
import styled from 'styled-components'

let Flex = styled.div`

    display: flex;
        justify-content:center;
        align-items:center;
        flex-direction:column;

`
let Title = styled.h1`
    font-size: 3rem;
    color: #fff;
    margin: 0 auto;
    background:transparent;
`
let Cblock = styled.div`
    margin: 5rem auto;
    max-width: 600px;
    height:600px;
    width: 100%;
    display:flex;
    flex-direction:column;

    background-color:#6066FF;
    border-radius:15px;
`

let Lbl = styled.label`
        color: #fff;
        margin: 0 1rem;
        background:transparent;

`
let Clmn = styled.div`
margin: 40px auto;
    display:flex;
    background:transparent;


`

export default function Register() {
  return (
    <Flex>
<Cblock>
<Title>Register</Title>
<Clmn>
<form >

            <Lbl htmlFor='register'>Register</Lbl>
            <input type='text'/>
            <Lbl htmlFor='register'>Register</Lbl>
            <input type='text'/>
            <Lbl htmlFor='register'>Register</Lbl>
            <input type='text'/>
            <Lbl htmlFor='register'>Register</Lbl>
            <input type='text'/>

    </form>
</Clmn>

</Cblock>

    </Flex>
  )
}
